import '../../../node_modules/augmented-ui/augmented-ui.min.css';
import './head.css';
import logo from '../../assets/other/logo.png';
import video from '../../assets/other/video.mp4';
import { Menu } from './menu-items';

function Head() {

    return (
        <div className='head'>
            <div className='head-top'>
                <img src={logo} alt='Cyberpunk' />
                <div className='menu'>
                    {
                        Menu.map((item, index) => (
                            <div className={`menu-item ${item.title === 'EN' ? 'mio' : ''}`} key={index}>
                                <div className='menu-item-shape'>
                                    {item.title}
                                </div>
                                {
                                    item.sub !== "" ? (
                                        <>
                                            <div className='menu-item-items-wrapper'></div>
                                            <div className='menu-item-items'>
                                                {
                                                    item.sub.map((itm, ind) => (
                                                        <div className='mii-item' key={ind}>
                                                            {itm}
                                                        </div>
                                                    ))
                                                }
                                            </div>
                                        </>
                                    ) : null
                                }
                            </div>
                        ))
                    }

                    <div className='menu-item menu-item-buy'>
                        <div className='menu-item-shape'>
                            BUY
                        </div>
                    </div>
                </div>
            </div>


            <div className='banner-video'>
                <div className='bv-shadow'></div>
                <div
                    className='video-frame'
                    data-augmented-ui='tl-clip bl-clip tr-scoop b-clip-x border'
                >
                    <video autoPlay loop muted>
                        <source src={video} type="video/mp4" />
                        Your browser does not support the video.
                    </video>

                    <div className='video-description'>
                        awefweaf
                    </div>
                    
                </div>
            </div>
        </div>
    )
}
export default Head;
